import React from 'react';

import { connect } from 'react-redux';
import {NavLink} from 'react-router-dom'

function Header() {

    React.useEffect(
        axios.post("https://ekreative-json-server.herokuapp.com/login")
      .then((response) => {
          if (response.data.resultCode === 0) {
              const { id, email, firstname, lastname, age } = response.data.data;
              props.setAuthUserData(id, email, firstname, lastname, age);
        }
      })
    )

    return (
        <div>
            <h1>Header</h1>

            <NavLink to={'/login'}>Login</NavLink><br/>
            <NavLink to={'/signup'}>signup</NavLink>

        </div>
    )
}

const mapStateToProps = (state) => ({})

export default connect( mapStateToProps, {setAuthUserData})(Header);
